import React from "react";
import AppBar from "@material-ui/core/AppBar";
import { makeStyles } from "@material-ui/core/styles";
import Toolbar from "@material-ui/core/Toolbar";
import HomeIcon from "../generalhome/HomeIcon";
import Link from "@material-ui/core/Link";
import "../../../../index.css";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
    backgroundColor: "#d2dae3",
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

export default function UserNavBar1() {
  const classes = useStyles();
  return (
    <div className={classes.grow}>
      <AppBar position="static" style={{ backgroundColor: "#00b643" }}>
        <Toolbar>
          <Grid container spacing={1}>
            <Grid item xs={1}>
              <Link
                href="/"
                style={{
                  color: "inherit",
                  fontFamily: "Lobster",
                  fontSize: "1.2rem",
                }}
              >
                My-Portfolio
              </Link>
              <HomeIcon></HomeIcon>
            </Grid>
            <Grid item xs={1}>
              <HomeIcon></HomeIcon>
            </Grid>
            <Grid item xs={1}>
              <Link
                href="/signinsuccess"
                style={{
                  color: "inherit",
                  fontSize: "1.2rem",
                }}
              >
                Create Protfolio
              </Link>
            </Grid>
            <Grid item xs={1}>
              <Link
                href="/signinsuccess"
                style={{
                  color: "inherit",
                  fontSize: "1.2rem",
                }}
              >
                Financial Goals
              </Link>
            </Grid>
            <Grid item xs={1}>
              <Link
                href="/signinsuccess"
                style={{
                  color: "inherit",
                  fontSize: "1.2rem",
                }}
              >
                Reports
              </Link>
            </Grid>
            <Grid item xs={1}>
              <Paper className={classes.paper}>xs=1</Paper>
            </Grid>
            <Grid item xs={3}>
              <Paper className={classes.paper}>xs=3</Paper>
            </Grid>
            <Grid item xs={3}>
              <Paper className={classes.paper}>xs=3</Paper>
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </div>
  );
}
